control.onControlLoad:
//鼠标点击行激活处理
g5.userId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 5; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 5; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.userId = null;
        return;
    }
    g5.id = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.f1 = g5.dataset1.getData(1, sender.rowIndex);
    g5.f2 = g5.dataset1.getData(2, sender.rowIndex);
    g5.f3 = g5.dataset1.getData(3, sender.rowIndex);
    g5.f4 = g5.dataset1.getData(4, sender.rowIndex);
    g5.f5 = g5.dataset1.getData(5, sender.rowIndex);
    g5.f6 = g5.dataset1.getData(6, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
ee.setText(ee.getControl("panel10"), "0");
ee.setEditText(ee.getControl("edit2"), "");
ee.setEditText(ee.getControl("edit4"), "");
ee.setEditText(ee.getControl("edit5"), "");
ee.setEditText(ee.getControl("edit6"), "");
ee.setEditText(ee.getControl("edit1"), "");
ee.setEditText(ee.getControl("edit7"), "");

g5.operation = "new";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行编辑");
    return;
}
ee.setText(ee.getControl("panel10"), g5.id);
ee.setEditText(ee.getControl("edit2"), g5.f1);
ee.setEditText(ee.getControl("edit4"), g5.f2);
ee.setEditText(ee.getControl("edit5"), g5.f3);
ee.setEditText(ee.getControl("edit6"), g5.f4);
ee.setEditText(ee.getControl("edit1"), g5.f5);
ee.setEditText(ee.getControl("edit7"), g5.f6);

g5.operation = "edit";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.id) || isNaN(g5.id)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

control.onUpdate:
if (eb.isEmpty(g5.dataset1)) return;
name1 = g5.dataset1.getData(3, sender.rowIndex);
name2 = g5.dataset1.getData(4, sender.rowIndex);
if ((name1.length==0)&amp;&amp;(name2.length==0)) {
    ee.setText(sender, "");
    return;
}
if (name1.length==0) {
    name1 = "无";
}
if (name2.length==0) {
    name2 = "无";
}
text = "<font color = '#d03030'>中文：</font>" + name1 + "<br/>"; 
text += "<font color = '#d03030'>英文：</font>" + name2;
ee.setText(sender, text);

if (eb.isEmpty(g5.dataset1)) return;
name1 = g5.dataset1.getData(5, sender.rowIndex);
name2 = g5.dataset1.getData(6, sender.rowIndex);
if ((name1.length==0)&amp;&amp;(name2.length==0)) {
    ee.setText(sender, "");
    return;
}
if (name1.length==0) {
    name1 = "无";
}
if (name2.length==0) {
    name2 = "无";
}
text = "<font color = '#d03030'>中文：</font>" + name1 + "<br/>"; 
text += "<font color = '#d03030'>英文：</font>" + name2;
ee.setText(sender, text);

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "(code3 like '%" + db.encode(searchText) + "%') or " +
        "(code4 like '%" + db.encode(searchText) + "%') or " +
        "(nameEn like '%" + db.encode(searchText) + "%') or " +
        "(nameCn like '%" + db.encode(searchText) + "%') or " +
        "(cityEn like '%" + db.encode(searchText) + "%') or " +
        "(cityCn like '%" + db.encode(searchText) + "%')) ";
}
sql =
    "SELECT count(*) as c " +
    "FROM airport " +
    "WHERE ([status] <> 'DEL') " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT * " +
    "FROM airport " +
    "WHERE (status <> 'DEL') " + condition;
    //"ORDER BY id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,code3,code4,cityCn,cityEn,nameCn,nameEn", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
    return;
}
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.user = eio.readString8();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody2"), g5.dataset1,0);   
ee.setText(ee.getControl("layoutxitem45"), g5.pageCurrent + "/" + g5.pageCount);
ee.setText(ee.getControl("panel16"), "共找到" +
    "<font color = '#d00000'>" + g5.pageRecordCount + "条</font>记录");

ee.setAutoScroll(ee.getControl("layoutyitem2"), false);   
setTimeout(function () { ee.setAutoScroll(ee.getControl("layoutyitem2"), true)}, 100);

taskSetItem.script2:
var token = eio.readString8();
var deleteUserId = eio.readInt32();

//获取用户信息及认证
var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("您已经长时间没有登录系统了，请返回登录页面重新登录");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//修改
sql = "update airport set status='DEL' where id = " + deleteUserId;
sqlResult = db.executeQuery("DB", sql); 
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}

eio.appendString8("T");
eio.appendString8(db.getString(sqlResult, "errorString"));

